from decimal import Decimal, getcontext
import copy

def find_longest_subsequence_length(sequence, k):
    getcontext().prec = 1001
    n = len(sequence)
    k = Decimal(k)
    a = [Decimal(str(x)) for x in sequence]
    if Decimal(0) in a:
        return n
    if k == Decimal(0):
        return 0
    left = copy.copy(a)
    right = copy.copy(a)
    for i in range(n - 1):
        left[i + 1] *= left[i]
    for i in reversed(range(n - 1)):
        right[i] *= right[i + 1]
    mul = left[-1]
    right.append(Decimal(1))
    r = []
    for (i, x) in enumerate(right):
        while r and r[-1][1] <= x:
            r.pop()
        r.append((i, x))
    l = [(-1, Decimal(1))]
    for (i, x) in enumerate(left):
        if not l or l[-1][1] < x:
            l.append((i, x))
    ans = 0
    at = -1
    for (i, x) in l:
        while at + 1 < len(r) and x * r[at + 1][1] * k >= mul:
            at += 1
        if at >= 0 and ans < r[at][0] - i - 1:
            ans = r[at][0] - i - 1
    return ans

